import styled from "styled-components";

const SectionSkill = () => {
  return (
    <Container>
      <Slide>
        <SlideWrap>
          <SlideList>
            <div class="s2Slide_txt">
              <a href="./sub/about.php" class="s2SlideBtn">
                insight
              </a>
              <span></span>
              <h4>a revelatory insight</h4>
            </div>
          </SlideList>
          <SlideList>
            <div class="s2Slide_txt">
              <a href="./sub/about.php" class="s2SlideBtn">
                insight
              </a>
              <span></span>
              <h4>a revelatory insight</h4>
            </div>
          </SlideList>
        </SlideWrap>
      </Slide>
    </Container>
  );
};
export default SectionSkill;

const Container = styled.div`
  width: 100%;
  height: 50vw;
  max-width: 1400px;
  margin: 0 auto;
`;

const Slide = styled.div`
  z-index: 1;
  position: relative;
  width: 100%;
  height: 969px;
`;

const SlideWrap = styled.ul`
  position: relative;
  width: 100%;
`;

const SlideList = styled.li`
  position: absolute;
  top: 0;
  left: 50%;
  width: 50%;
  height: 300px;
  background: #fff;
`;
